import React from 'react';

const CarServices = (props) => {

  const servicesForCar = props.allCars.map((cars) => {
    return cars.map((car) => {
      if (car.id !== props.loadCarServices) {
        return null;
      }
      return (
        car.services = service,
        <ul key={car.id}>
          <li>
            brand:<p>{car.brand}</p>
          </li>
          <li>
            series:<p>{car.series}</p>
          </li>
          <li>
            model:<p>{car.model}</p>
          </li>
          <li>
            year:<p>{car.year}</p>
          </li>
          <li>
            engine:<p>{car.engine}</p>
          </li>
          <li>
            mileage:<p>{car.mileage}</p>
          </li>
        </ul>
      );
    });
  });

  return (
    <div className="car-services">
      {servicesForCar}
    </div>
  );
};

export default CarServices;
